import React from 'react';

import { Container } from './styles';

function Card({ data }) {
    return (
        <>
            <Container>
                <span>1</span>
                <p>{data} maria da silva</p>
                <p>Points: 10</p>
            </Container>
        </>
    )
}

export default Card;
